INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 7001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 7002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 7003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 10001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 10002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 10003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, 106401, 2, 2104010, "2030/12/17 14:59:59", 0.0, 10004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 12001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 13001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 13002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, 106401, 2, 2104010, "2030/12/17 14:59:59", 0.0, 13003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 13004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 14001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, 106401, 2, 2104010, "2030/12/17 14:59:59", 0.0, 14002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 14003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 14004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 15001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, 106401, 2, 2104010, "2030/12/17 14:59:59", 0.0, 16001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 16002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 16003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 16004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 17002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 17004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 17005, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, 106401, 2, 2104010, "2030/12/17 14:59:59", 0.0, 17006, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 17007, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 18001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 18002, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 19001, 3, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 19002, 4, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 20001, 5, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 20002, 6, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 21001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 21002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, 106401, 2, 2104010, "2030/12/17 14:59:59", 0.0, 21003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 21004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 22001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 22002, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 23001, 3, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 23002, 4, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, 109001, 1, 0, "2030/12/17 14:59:59", 4.08, 24001, 1, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, 109001, 1, 0, "2030/12/17 14:59:59", 5.0, 24002, 2, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, 109001, 1, 0, "2030/12/17 14:59:59", 10.11, 24003, 3, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, 109001, 1, 0, "2030/12/17 14:59:59", 4.0, 24004, 4, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, 109001, 1, 0, "2030/12/17 14:59:59", 6.0, 24005, 5, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 109002, 1, 0, "2030/12/17 14:59:59", 0.0, 24006, 6, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 109002, 1, 0, "2030/12/17 14:59:59", 0.0, 24007, 7, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 109002, 1, 0, "2030/12/17 14:59:59", 0.0, 24008, 8, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 109002, 1, 0, "2030/12/17 14:59:59", 0.0, 24009, 9, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 109002, 1, 0, "2030/12/17 14:59:59", 0.0, 24010, 10, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, 109101, 1, 0, "2030/12/17 14:59:59", 2.12, 24011, 1, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, 109101, 5, 0, "2030/12/17 14:59:59", 4.19, 24012, 2, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 4, 8.0, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, 109101, 2, 0, "2030/12/17 14:59:59", 2.3, 24013, 3, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 109102, 1, 0, "2030/12/17 14:59:59", 0.0, 24014, 4, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, 109101, 5, 0, "2030/12/17 14:59:59", 5.23, 24015, 5, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 109102, 1, 0, "2030/12/17 14:59:59", 0.0, 24016, 6, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 2, 8.0, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, 109101, 1, 0, "2030/12/17 14:59:59", 5.01, 24017, 7, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 109102, 1, 0, "2030/12/17 14:59:59", 0.0, 24018, 8, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 109102, 1, 0, "2030/12/17 14:59:59", 0.0, 24019, 9, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", "2019/01/31 12:00:00", 1, 0.0, 24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 109102, 1, 0, "2030/12/17 14:59:59", 0.0, 24020, 10, 10011);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 26, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, 106401, 2, 2104010, "2030/12/17 14:59:59", 0.0, 26001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 26, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 26002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 26, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 26003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 26, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 26004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 27, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", -363.0, 106401, 2, 2104010, "2030/12/17 14:59:59", 0.0, 27001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 27002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 27003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 27, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 27004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2019/09/24 15:00:00", 1, 0.0, 28, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", -363.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 28001, 1, 0);
