INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2019/09/24 15:00:00", 1, 0.0, 29, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", -409.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 29001, 3, 0);
