INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2019/10/31 12:00:00", 1, 0.0, 31, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", -409.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 31001, 7, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2019/10/31 12:00:00", 1, 0.0, 31, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", -409.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 31002, 8, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2019/12/20 5:00:00", 1, 0.0, 32, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", -409.0, 190801, 1, 0, "2020/01/04 4:59:59", 0.0, 32001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2019/12/20 5:00:00", 1, 0.0, 32, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 190801, 1, 0, "2020/01/04 4:59:59", 0.0, 32002, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2019/12/20 5:00:00", 1, 0.0, 33, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", -409.0, 190801, 1, 0, "2020/01/04 4:59:59", 0.0, 33001, 3, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2019/12/20 5:00:00", 1, 0.0, 33, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 190801, 1, 0, "2020/01/04 4:59:59", 0.0, 33002, 4, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2020/01/04 5:00:00", 1, 0.0, 34, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", -409.0, 190801, 1, 0, "2020/01/10 11:59:59", 0.0, 34001, 5, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2020/01/04 5:00:00", 1, 0.0, 34, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", -409.0, 190801, 1, 0, "2020/01/10 11:59:59", 0.0, 34002, 6, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 2, 0.0, 38, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", -458.0, 105801, 1, 0, "2030/12/17 14:59:59", 5.3, 38001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 2, 0.0, 38, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", -458.0, 105801, 1, 0, "2030/12/17 14:59:59", 6.5, 38002, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2020/04/01", 3, 9999.0, 39, "", 9999.0, 105801, 3, 0, "2020/04/08 23:59:59", 0.0, 39005, 0, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", "2015/12/17 15:00:00", 1, 0.0, 40, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", -430.0, 190801, 1, 0, "2030/12/17 14:59:59", 0.0, 40001, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 41, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", -363.0, 106401, 1, 2104010, "2030/12/17 14:59:59", 0.0, 41001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 41, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 41002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 41, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 41003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 41, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 41004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 42, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", -416.5, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 42001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", "2015/12/17 15:00:00", 1, 0.0, 42, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", -416.5, 106401, 1, 2104010, "2030/12/17 14:59:59", 0.0, 42002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 42, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", -416.5, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 42003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 42, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", -416.5, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 42004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", "2015/12/17 15:00:00", 1, 0.0, 43, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", -363.0, 105801, 1, 0, "2030/12/17 14:59:59", 0.0, 43001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", "2015/12/17 15:00:00", 1, 0.0, 43, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", -363.0, 105901, 1, 0, "2030/12/17 14:59:59", 0.0, 43002, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", "2015/12/17 15:00:00", 1, 0.0, 43, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", -363.0, 106001, 1, 0, "2030/12/17 14:59:59", 0.0, 43003, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("アメス", "2015/12/17 15:00:00", 1, 0.0, 44, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", -416.5, 123001, 1, 0, "2030/12/17 14:59:59", 0.0, 43004, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("アメス", "2015/12/17 15:00:00", 1, 0.0, 44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", -416.5, 123001, 1, 0, "2030/12/17 14:59:59", 0.0, 43005, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("アメス", "2015/12/17 15:00:00", 2, 0.0, 45, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", -416.5, 123001, 1, 0, "2030/12/17 14:59:59", 5.79, 43006, 3, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("アメス", "2015/12/17 15:00:00", 1, 0.0, 46, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", -371.5, 123001, 1, 0, "2030/12/17 14:59:59", 0.0, 46001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル", "2015/12/17 15:00:00", 2, 0.0, 47, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", -416.5, 104901, 2, 0, "2030/12/17 14:59:59", 0.0, 47001, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("リノ", "2015/12/17 15:00:00", 2, 0.0, 47, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", -416.5, 101101, 1, 0, "2030/12/17 14:59:59", 9.32, 47002, 1, 0);
